		<i>  Speaker: Bibhuprasad Mahakud </i>

	</div>


	 <div className={classes.onePresentation_talkTitleDiv}> <span style={{color:"grey"}}> Time:  8:00pm (India/Kolkata Time), 15 Minutes </span></div>	

         <div className={classes.onePresentation_talkTitleDiv} style={{color:"grey"}}> 

	    <span> Attachments: 
		     <button style={{textDecoration:"underline",color:"#0000EE",borderStyle:"none",background:"white"}}
                             onClick={openFileInNewTabHandler}
		             >
		           Update_22ndMay2022.pdf <BsBoxArrowUpRight/>
		     </button>

	             <Link to={{pathname: `${imageurl}`}}  target="_blank"><BsBoxArrowUpRight className={classes.openNewTabL}/></Link>










	    <button style={{marginLeft:"20px",borderStyle:"none"}}> +add file </button>

	    </span>	



            <button className={classes.talkEditButton}> <BiEdit/> </button>

	</div>


</div>


}

export default OnePresentation;
